import React from 'react';
import Slider from 'react-slick';
import Hero from './Hero-container';
import { imgdata } from './img-data';
import './Main-container.css';
import './Slider';

function Main() {
  return (
    <div className='Main-container'>
    <Hero slides={imgdata}/>
    <ImageSlider/>
    </div>
  );
}

export default Main;
